import React, { useState } from 'react';
import axios from 'axios';
import { toast, ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import './LoanForm.css'; // Ensure this path is correct
import { useNavigate } from 'react-router-dom';

const LoanForm = () => {
  const [formData, setFormData] = useState({
    Full_Name: '',
    Address: '',
    PAN_Number: '',
    Company_Name: '',
    Current_Salary: '',
    Previous_Salary: '',
    Owns_House: '',
    Rent_Amount: '',
    Grocery_Expense: '',
    Current_EMIs: '',
    Date_Previous_Hike: '',
    Date_Next_Hike: '',
    Bank_Name: '',
    Credit_Score: '',
    Number_of_Credit_Cards: '',
    Total_Credit_Limit: '',
    Number_of_Loans: '',
    Employment_Duration: '',
    Job_Title: '',
    Bonuses_Allowances: '',
    Savings: '',
    Investments: '',
    Monthly_Expenses: '',
    Age: '',
    Education_Level: '',
    Marital_Status: '',
    Dependents: '',
    Loan_Purpose: '',
    Mall_Visits_Per_Month: '',
    Mall_Spend_Average: '',
    Loan_Details: []
  });

  const [loanDetails, setLoanDetails] = useState([]);
  
  const bankOptions = [
    'State Bank of India',
    'HDFC Bank',
    'ICICI Bank',
    'Axis Bank',
    'Kotak Mahindra Bank',
    'Bank of Baroda',
    'Punjab National Bank',
    'Canara Bank',
    'Union Bank of India',
    'Indian Bank',
    'IndusInd Bank',
    'IDFC FIRST Bank',
    'Bandhan Bank',
    'Yes Bank',
    'South Indian Bank',
    'Ujjivan Small Finance Bank',
    'RBL Bank',
    'Federal Bank',
    'Lakshmi Vilas Bank',
    'Jammu & Kashmir Bank',
    'Karur Vysa Bank',
    'Others'
  ];

  const jobTitleOptions = [
    'Software Engineer',
    'Data Analyst',
    'Product Manager',
    'Financial Analyst',
    'Marketing Manager',
    'Sales Executive',
    'HR Manager',
    'Consultant',
    'Graphic Designer',
    'Project Manager',
    'Business Analyst',
    'Operations Manager',
    'Customer Service Executive',
    'Accountant',
    'Content Writer',
    'Web Developer',
    'UX/UI Designer',
    'Network Engineer',
    'Digital Marketer',
    'Administrative Assistant',
    'Research Scientist',
    'Others'
  ];
  
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevFormData => {
      if (name === 'Number_of_Loans') {
        const numLoans = parseInt(value) || 0;
        setLoanDetails(Array(numLoans).fill({ EMI: '', Tenure: '' }));
      }
      
      if (name === 'Owns_House' && value === 'Yes') {
        return {
          ...prevFormData,
          [name]: value,
          Rent_Amount: '' // Clear Rent_Amount when Owns_House is "Yes"
        };
      }

      return {
        ...prevFormData,
        [name]: value
      };
    });
  };

  const handleLoanDetailChange = (index, field, value) => {
    const updatedLoanDetails = [...loanDetails];
    updatedLoanDetails[index][field] = value;
    setLoanDetails(updatedLoanDetails);
  };

  const validateForm = () => {
    for (const key in formData) {
      if (formData[key].trim() === '' && key !== 'Loan_Details') {
        return true;
      }
    }
    if (loanDetails.some(detail => detail.EMI.trim() === '' || detail.Tenure.trim() === '')) {
      return true;
    }
    return false;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (validateForm()) {
      toast.error('Please check fields again');
      return;
    }

    try {
      const response = await axios.post('http://127.0.0.1:5000/predict', { ...formData, Loan_Details: loanDetails });
      const data = response.data;
      console.log('Prediction Results:', response.data);
      toast.success('Loan application submitted successfully!');
      navigate('/result', { state:{ resultData: data }});
    } catch (error) {
      console.error('Error making prediction:', error.response ? error.response.data : error.message);
      toast.error('An error occurred while submitting the application.');
    }
  };

  return (
    <form onSubmit={handleSubmit} className="form-all">
      <ToastContainer />
      {/* Personal Information Section */}
      <div className="form-section">
        <h2>Personal Information</h2>
        {/* Personal Information Fields */}
        {/* ... (existing fields) */}
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Mall Visits Per Month
              <input
                type="number"
                name="Mall_Visits_Per_Month"
                value={formData.Mall_Visits_Per_Month}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Mall Spend Average
              <input
                type="number"
                name="Mall_Spend_Average"
                value={formData.Mall_Spend_Average}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
        </div>
      </div>
      
      {/* Financial Information Section */}
      <div className="form-section">
        <h2>Financial Information</h2>
        {/* Financial Information Fields */}
        {/* ... (existing fields) */}
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Number of Loans
              <input
                type="number"
                name="Number_of_Loans"
                value={formData.Number_of_Loans}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
        </div>
      </div>
      
      {/* Loan Details Section */}
      <div className="form-section">
        <h2>Loan Details</h2>
        {loanDetails.map((loan, index) => (
          <div className="form-row" key={index}>
            <div className="form-line">
              <label className="form-label">
                Loan {index + 1} EMI
                <input
                  type="number"
                  name={`Loan_${index + 1}_EMI`}
                  value={loan.EMI}
                  onChange={(e) => handleLoanDetailChange(index, 'EMI', e.target.value)}
                  min="0"
                  className="form-textbox"
                />
              </label>
            </div>
            <div className="form-line">
              <label className="form-label">
                Loan {index + 1} Tenure
                <input
                  type="number"
                  name={`Loan_${index + 1}_Tenure`}
                  value={loan.Tenure}
                  onChange={(e) => handleLoanDetailChange(index, 'Tenure', e.target.value)}
                  min="0"
                  className="form-textbox"
                />
              </label>
            </div>
          </div>
        ))}
      </div>

      {/* Submit Button */}
      <div className="form-section">
        <button type="submit" className="submit-button">Submit</button>
      </div>
    </form>
  );
};

export default LoanForm;
